import React from "react";

const Table = ({ orders }) => {
  const onClickDelete = (deleteOrder) => {
    const newOrders = orders.filter(order => order.plate_id === deleteOrder.plate_id)
    console.log(newOrders)
  };
  const onClickUpdate = () => {
    console.log("Me hicieron click :V2");
  };

  return (
    <div className="card p-3">
      <table className="table table-striped">
        <thead>
          <tr>
            <th scope="col">Plato</th>
            <th scope="col">Cantidad</th>
            <th scope="col">Acciones</th>
          </tr>
        </thead>
        <tbody>
          {orders.map((order) => (
            <tr>
              <td key={order.name}>{order.name} </td>
              <td key={order.amount}>{order.amount} </td>
              <td key={order.plate_id}>
                <a onClick={() => onClickDelete(order)}>
                  <i className="fas fa-trash-alt px-2"></i>
                </a>
                <a onClick={() => onClickUpdate()}>
                  <i class="fas fa-edit px-2"></i>
                </a>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Table;
